      <ol>
        <li>Mechanical Breakdown Insurance MBI in case things break down on your car</li>
        < BingSearch />
        <li>Car insurance: in case of accident, fire, theft and 3rd Party damage</li>
      </ol>
    </main>
  );
};

export default Main;
